import React from 'react';
import MapImage from '../public/assets/map-image.png';

class ContactContent extends React.Component {
    constructor(props) {
      super(props);

    }

    render() {
            return (
            <div id="contentContainer">
              <p id="contactText">Contact info goes here</p>
              <div className="contentCanvas">
                <img id="mapImg"  src={MapImage} />
              </div>

              <style jsx>
                {`

                #contentContainer {
                  position: absolute;
                  margin-top: 175px;
                  height: 60vh;
                  margin-left: 10%;
                  width: 80vw;
                  background-image: url('data:image/png;base64,');
                  background-color: rgb(192,192,192);
                  border-radius: 8px;
                  min-width: 450px;
                }

                @media (max-width: 720px) {
                  #contentContainer {
                    height: 73vh;
                    min-height: 575px;
                  }
                }
                
                #mapImg {
                  width: 100%;
                  height: 80%;
                  border-radius: 12px;
                  position: relative;
                  transform: translate(0%, 12.5%);
                }

                @media (max-width: 720px) {
                  #mapImg {
                    height: 300px;
                  }
                }
              
                .contentCanvas {
                  width: 55%;
                  height: 100%;
                  transform: translate(0%, 0%);
                  right: 0px;
                  position: absolute;
                  margin-right: 5%;
                }

                @media (max-width: 720px) {
                  .contentCanvas {
                    width: 90%;
                  }
                }

                #contactText {
                  width: 40%;
                  position: absolute;
                  top: 40%;
                }

                @media (max-width: 720px) {
                  #contactText {
                    width: 80%;
                    position: absolute;
                    top: 70%;
                    left: 10%
                  }
                }
                
                `}
              </style>
            </div>
            ) 
              }
}

export default ContactContent;
